import React from "react";
import { Link } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { setMovies } from "../store/movies";

const Movies = () => {
  const { Search } = useSelector((state) => state.movies);

  const dispatch = useDispatch();

  console.log("MOVIESSSSSSSSSS", Search);

  return (
    <div className="moviesMainDiv">
      {Search &&
        Search.map((movie, index) => {
          return (
            <div key={movie.imdbID}>
              <div className='movieRowDiv'>
                <h1>{movie.Title}</h1>
                <img className='image' src={movie.Poster}></img>
              </div>
            </div>
          );
        })}
    </div>
  );
};

export default Movies;
